  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";

import router from './router';

function App() {
  return (
    <div className="App">
      <RouterProvider router={router}></RouterProvider>
    </div>
  );
}

export default App;
